"date": "1731-01-02",
"tags_section": "Perlohnen ihre Dienste offeriren",
"text": "1. Ein junger Mensch, 24. Jahr alt von ehrlichem Herkommen,als weyland reicher Eltern Conduite sich in Jugend pur nach Delicien zu belieben erfundiget werden, fuchet Condition als Handels=Diener in einem guthen Hause, in Commercien, oder bey Scarpanen und Italienisch, und wo es erfordert wird zu Franckfurthischen Correspondenten und andern Handels= Verrichtungen gute Dienste zu leisten; und alles Nergnigen zu haben, fundet man bey ehrlichen und feinen Herren Beller Salarium bey sich bey dem H.n. Ba- tronen / wenn tin Capacistt haben / genugfame Pro- ben abgelegt und geziagt haben wird) offerirt auff die Prob zu kommen und die Meist=Spesen zu befofrdern; oder wo nicht befodert werden folte, zu befofrdern; oder wo nicht befodert werden folte, zu einem ehrlichen Abfchiede verhelffen. 2., Mitz. Michaelsen Moßbauchinn, mohnthafftig zu Stadt an der Ober=Kleibung in dem Fofengändner= ten Nachgelaffenen, offerirt feine Dienste in Einferde- rung Echuld/ und andern Sachen; es fey im Sungbau / Marggrafenthum; Baßler Gebiet; oder andern."
},
{
"date": "1731-01-02",
"tags_section": "Perlohnen ihre Dienste offeriren",
"text": "3. Der Herzog Müller von Lyon, wirdiger von geraumer Zeit feine Dienste in Verfchiedener Accommodation, Zufriedenheit feiner Herren Principalen, zu Pferde und zu Fuffe, mit Fleiß bedienet haben; Ablegung und Auffickung zu mehr in aller Art von Verrichtungen, Mamn's Frauen und Jungfer Strumpffn, und in Sterfferttigung der Bäckenlein und Koufientifien offerirt er feine Dienfte, kanfte der eigentlichen Befchreibung feiner bißhergehabten Conditionen und diefen Buch erwehnlet wird, fucht mit diefem Bey- fatz man vor jedes Contrefait von 6. Königlichen Franden Franz Bußmillet hier anderwarts durch arbcithet und verfertigte Weiber auff 6. Kilogramma wol- le firchen laffen; und erwehnlet thun den Berften Verlegeren einen erklecklichen affecurantz haben fie die 50 g. Franden darju bezahlen. Beftetfende feine umbftändlichen und Zufatzliche Berichte uber je deffelben Ortlichkeit / folte mogen weder auff Mag aincknüfft wird man feinen andern als jzigen Aufenthalt 24. Franden zu Nachfrag haben, von dorten kann man Briefe anhero addressiren, und wird man auff Verlangen mit Original-Contrafeten durchgengig gleichfals, und mit der Röder oder Chineschen Dinte feht wohl fauber gefchrift. Die Plan wirdt also in den nechsten zugefellt/ welche zu der Zunfft/ Vollkommenheit etwas beyzutragen etwas beordgen mern. Wan wird das Gelt denen Handen und Supplies fo fort zu Sunnen darauff gleichfals, und Johann Jadack, Königl. Tre- forier allhier zu Bailff wirdt die Herren Röder und Chineschen Dinte zu empfangen haben."
},
{
"date": "1731-01-02",
"tags_section": "Allerhand Nachrichtten",
"text": "Machende zum Trefe und Wieder-Auffbauung ihrer ruinirten und abgebrannten Hausern, auch richteten zugerichteten Losamentern, und befinder sich glicklich zu haben, die drey Johan Collegien habe benuambt Regiftrators-Boden, Concipist und dergl. welche zu drey Claffen und 4000. fl. in drey Jahren zufammen follen erhoben werden, wie auch die Herren Affefforen und Befehls=Leute die Lika- Staab/ und andere Bediente, haben fich anhero zu addressiren, wann fie diefe Gnade geniefen wollen. GOtt wirdt die Gerechtigkeit erheben, und die Gottlofe verfolgen. Die Authorn der Lateinifchen Herrn Zeitung erfuchet diejenige, welche diefe Zeitung zu continuiren wolten, mit dienstl. Erfuchen zu befchicken, damit man diefes Werck mit nechstem fortfetzen könne."
},
{
"date": "1731-01-02",
"tags_section": "Wentige Stadt=Merckwurdigkeiten",
"text": "Eben letztfern Monats find getodten und bo- graben worden : Herr Doctor Medicina, und Profeffor Publ. Ordinar. zu hiefiger Univerfitat, auch Hoch=Furftlich=Heffifcher Rath, hat in feinem letzten Willen feine hinterlaffene Verlaffenfchafft zu guthen Wercken und milden Sachen gewidmet, und feine Bibliothec der Univerfitat vermacht."
}
